import { useState } from 'react'

import '../styles/header.css'

function Header(props){

    const {storeName, home, store, about} = props;

    return(

        <div className = 'header'>
            <h1>{storeName}</h1>
            <h2>{home}</h2>
            <h2>{store}</h2>
            <h2>{about}</h2>
        </div>
    )
}
export {Header}
